use reqwest::blocking::get;
use reqwest::header::HeaderMap;
use reqwest::Client;
use clipboard::ClipboardProvider;
use fluent_synthesis::{Engine, FluentBundle, FluentResource, FluentValue};

fn main() {
    // Create a client for making HTTP requests
    let client = Client::new();

    // Read the contents of the clipboard
    let mut clipboard = ClipboardProvider::new().unwrap();
    let clipboard_contents = clipboard.get_contents().unwrap();

    // Make a request to the ElevenLabs API
    let mut headers = HeaderMap::new();
