    let message = bundle.get_message("tts").unwrap();
    let value = message.value().unwrap();

    // Use the `fluent-synthesis` crate to convert the text to speech
    let engine = Engine::new().unwrap();
    let speech = engine.render(&value).unwrap();
    engine.play(&speech).unwrap();
}
